           + (tex2D(sampler_noise_lq, dither_uv).xy-0.5)*texsize.zw*2
           + float2(dy.x,-dx.x)*texsize.zw*64
           + float2(dx.z,dy.z)*texsize.zw*0;
ret.z = tex2d(sampler_fc_main,uvz).z
      + (tex2d(sampler_fc_main,uvz).z-GetBlur2(uvz).z)*0.2 
      + (tex2D(sampler_noise_lq, dither_uv).xyz)*0.1
      - GetBlur3(uv_orig).x
      - saturate(1-GetBlur2(uv_orig).x)*0.04;
